ia.com.br<br/>Nome: Luísa<br/>Email: luisa.bonacina@gmail.com<br/>Telefone: 5186144775<br/>Estado: Viamão<br/>Cidade: RS<br/>Mensagem: Olá!\nPosso comprar ingressos meia-entrada apenas com o comprovante de matrícula da Universidade? E no dia do evento levar o comprovante de matrícula impresso para apresentar na entrada do festival.', '54.94.161.246', '2015-09-03 20:57:26', '0', 'São Paulo', 'BR', 'Sao Paulo', null, '-23.4733,-46.6658', '0', null, '1'), ('526', '', 'cassinha.lacerda@gmail.com', 'contato@universoalegria.com.br', '29', 'contato@universoalegria.com.br - 03/09/2015', 'Para: contato@universoalegria.com.br<br/>Nome: Cássia Franciele Gama Lacerda<br/>Email: cassinha.lacerda@gmail.com<br/>Telefone: 5186539978<br/>Estado: Esteio<br/>Cidade: Rio Grande Do Sul<br/>Mensagem: Olá pessoal da Radio Alegria! como estão ? então, moro em esteio no mesmo bairro do parque de exposições Assis Brasil, onde acontece todos os anos o Universo Alegria. eu não perdi um ano, sem ser em 2012, mas sempre tive como evento sagrado no ano comparecer no universo. Eu estava contando os dias para comprar os ingressos do camarote radio alegria porem hoje quando fui entrar no site me deparei com o 3 lote, só poderia comprar hoje por motivos de parcelamento e faturas. Me decepcionei muito pois por motivos financeiros vai ser o primeiro ano em que o luan vem no universo que eu não vou. Todos os anos em que ele esteve aqui eu estava, e dessa vez infelizmente não vou poder ir. Sei que vocês são uma radio em que tratam muito bem seus ouvintes e eu ficaria muito agradecida se vocês pudessem fazer com que eu, minha irmã e minha mãe compareça no evento! Sei que pode ser pedir muito mas nós realmente levamos o universo como um evento MUITO importante e somos muito fãs do Luan também!! obrigada pela atenção desde já e desculpa pelo incomodo.', '54.94.161.246', '2015-09-03 20:59:28', '0', 'São Paulo', 'BR', 'Sao Paulo', null, '-23.4733,-46.6658', '0', null, '1'), ('527', 'Jo Rubim Nobre', 'jonobre@