e duas almas apaixonadas.\nEu gostaria de pedir humildemente a radio e o Bruno e o Marrone  me ajudem a fazer uma prova de amor, uma homenagem de forma que irá marcar para sempre nosso relacionamento.\nEu gostaria realmente da ajuda de vocês para que eu possa fazer um pedido de noivado histórico.\nE na frente de milhares de pessoas dizer a esta pessoa o quanto ela é importante na minha vida e o quanto eu há amo.\nPedir ela em noivado na frente de um mar de gente. \nAo som de uma música do Bruno e Marrone que eu já cantei no ouvido dela. Que diz assim..\n\nQuer quer quer, \nQuer casar comigo,\nSer mais que bons amigos..\n\nIrá acontecer o universo alegria no parque Assis Brasil em esteio gostaria de pedir  humildemente que me permitam Fazer esse nobre pedido de noivado no palco na frente de milhares de pessoas.\nSei que meu pedido parece exatamente exagerado mas peço humildemente me dêem essa oportunidade.\n\nAtenciosamente \nRalf Daniel \nCel: 51 9424-7555<br/> ', '54.94.161.246', '2015-10-01 02:27:14', '0', 'São Paulo', 'BR', 'Sao Paulo', null, '-23.5475,-46.6361', '0', null, '1'), ('1032', '', 'tanisemendes@hotmail.com', 'contato@universoalegria.com.br', '29', 'contato@universoalegria.com.br - 01/10/2015', 'Para: contato@universoalegria.com.br<br/>Nome: tanise<br/>Email: tanisemendes@hotmail.com<br/>Telefone: 86219705<br/>Estado: Alvorada <br/>Cidade: Rio grande do sul<br/>Mensagem: Poderia mi informar se vai ter outras marcas de cerveja sem ser kaiser?  E no open bar tbm? <br/> ', '54.94.161.246', '2015-10-01 09:47:20', '0', 'São Paulo', 'BR', 'Sao Paulo', null, '-23.5475,-46.6361', '0', null, '1'), ('1033', '', 'tanisemendes@hotmail.com', 'contato@universoalegria.com.br', '29', 'contato@universoalegria.com.br - 01/10/2015', 'Para: contato@universoalegria.com.br<br/>Nome: tanise<br/>Email: tanisemendes@hotmail.com<br/>Telefone: 86219705<br/>Estado: Alvorada <br/>Cidade: Rio grande do sul<br/>Mensagem: Poderia mi informar se vai ter outras marcas de cerveja sem se