ém nas suas redes sociais e site, sem custo porque para nós também é importante pela visibilidade, cobrimos os principais eventos e festas da região com muita profissionalidade e a linguagem de cada publico, temos uma media de 5000 visualizações mensais de nosso conteúdo na internet. Gostaria de saber com quem poderia falar da Rádio Alegria ou da organização do Universo Alegria para fazer essa cobertura?\n\nPoderíamos cobrir normalmente ou se quiserem podemos até adesivar uma canopla de nosso microfone com os logos da Rádio Alegria ou do evento e entrevistar o diretor, comunicadores, funcionários da emissora, publico e artistas. Hoje daqui a pouco estaremos na Rádio Alegria para outros assuntos, mas se caso haver a possibilidade e vocês acharem interessante podemos conversar hoje sobre isso. Nossa equipe para esse evento, seria 3 pessoas. \n\nConfira nossos trabalhos:\n\nhttps://www.youtube.com/watch?v=kNQRZycW34Y Garota Verão\nhttps://www.facebook.com/adrianotherockshow/videos/vb.100002845010345/712581635513330/?type=3&theater Funk\nhttps://www.youtube.com/watch?v=BVkh3U1dmb0 Evento Atlântida\nhttps://www.facebook.com/adrianotherockshow/videos/vb.100002845010345/601584993279662/?type=3&theater Evento Atlântida\nhttps://www.youtube.com/watch?v=OL-s19jJ-eo Balada\nhttps://www.youtube.com/watch?v=6fc8MpZZmpw Evento Aniversario da cidade\nhttps://www.facebook.com/adrianotherockshow/videos/vb.100002845010345/685060634932097/?type=3&theater Skate\nhttps://www.facebook.com/adrianotherockshow/videos/vb.100002845010345/678490005589160/?type=3&theater rádio\nhttps://www.youtube.com/watch?v=C6FIutVeBJ4 Locução rádio\nhttps://www.facebook.com/adrianotherockshow/videos/vb.100002845010345/672438429527651/?type=3&theater festa flash back\nhttps://www.youtube.com/watch?v=OQidW5zeZSQ Nativismo\nhttps://www.youtube.com/watch?v=iEyUAJ3QpXQ Rock\nhttps://www.youtube.com/watch?v=Dd7TPdYXsO4 Funk\n<br/> ', '54.94.161.246', '2015-10-20 10:37:45', '0', 'São Paulo', 'BR', 'Sao Paulo', null